// SPDX-License-Identifier: MIT

pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./lib/IPancakeRouter.sol";
import "./lib/Withdrawable.sol";

contract EventBuyBox is Pausable, Ownable, ReentrancyGuard, Withdrawable {

    address public token;
    address public BoxNFT;
    uint256 public startTime;
    uint256 public amountBoxSold;

    address private pancakeRouterV2Contract = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address private bnbContract = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    address private busdContract = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56;

    event BuyingBox(address indexed user);

    uint256 public totalSellBox = 0;

    constructor(address _token, address _contractBox) {
        token = _token;
        BoxNFT = _contractBox;
        startTime = 1652249488;
        amountBoxSold = 10;
    }

    function editAmountBoxSold(uint256 _amountBox) public onlyOwner nonReentrant{
        amountBoxSold = _amountBox;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function BuyBox(uint256 _amountBox) public whenNotPaused nonReentrant {
        require(startTime <= block.timestamp,"This Event Not Yet Start Time" );
        require(_amountBox <= amountBoxSold, "Exceeded the limit on the number of boxes");
        require(_amountBox > 0, "Number of box have to be greater than 0");
        uint256 _amountTokenToBuyBox = _calcCurPriceToken();

        _amountTokenToBuyBox = _amountTokenToBuyBox * _amountBox;

        IERC20(token).transferFrom(msg.sender, address(this), _amountTokenToBuyBox);

        for (uint256 i = 0; i < _amountBox; i++) 
        {
            uint256 _tokenId = IERC721Enumerable(BoxNFT).tokenOfOwnerByIndex(address(this), 0);
            IERC721(BoxNFT).safeTransferFrom(address(this), msg.sender, _tokenId);
            totalSellBox++;
        }
        emit BuyingBox(msg.sender);
    }

    function _calcCurPriceToken()
        internal
        view 
        returns(uint256)
    {
        address[] memory path;
        path  = new address[](2);
        path[0] = token;
        path[1] = bnbContract;
        uint256[] memory _oneTokenWithBNBArr = IPancakeRouter01(pancakeRouterV2Contract).getAmountsOut(1*(10**18), path);
        path  = new address[](2);
        path[0] = bnbContract;
        path[1] = busdContract;
        uint256[] memory _oneBNBWithBusdArr = IPancakeRouter01(pancakeRouterV2Contract).getAmountsOut(1*(10**18), path);
        uint256 _oneTokenWithBNB = _oneTokenWithBNBArr[1];
        uint256 _oneBNBWithBusd = _oneBNBWithBusdArr[1];
        uint256 _curPriceToken = (_oneTokenWithBNB*_oneBNBWithBusd)/ (10**18);
        uint256 _totalPaidToken = 1000 * (10**18) / _curPriceToken;

        return _totalPaidToken*(10**18);      
    }

    event Received(address, uint);
    receive () external payable {
        emit Received(msg.sender, msg.value);
    }
}

contracts/lib/Withdrawable.sol.content:
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Withdrawable is Ownable {

    // amount BNB
    function withdrawNative(uint256 _amount) public onlyOwner {
        require(_amount > 0 , "_amount must be greater than 0");
        require( address(this).balance >= _amount ,"balanceOfNative:  is not enough");
        payable(msg.sender).transfer(_amount);
    }

    function withdrawToken(IERC20 _token, uint256 _amount) public onlyOwner {
        require(_amount > 0 , "_amount must be greater than 0");
        require(_token.balanceOf(address(this)) >= _amount , "balanceOfToken:  is not enough");
        _token.transfer(msg.sender, _amount);
    }

    // all BNB
    function withdrawNativeAll() public onlyOwner {
        require(address(this).balance > 0 ,"balanceOfNative:  is equal 0");
        payable(msg.sender).transfer(address(this).balance);
    }

    function withdrawTokenAll(IERC20 _token) public onlyOwner {
        require(_token.balanceOf(address(this)) > 0 , "balanceOfToken:  is equal 0");
        _token.transfer(msg.sender, _token.balanceOf(address(this)));
    }
}

